import React, { Component } from 'react';
import "./App.css"

import Card from './Card/Card';

class App extends Component {
    render() {
        return (
            <div id='app'>
                <Card size={100} posX={20} posY={20} face={false} color="yellow" cardName="1"/>
            </div>
        );
    }
}

export default App;
